/*****************************************************************************
* Prototype :   SVP_NNIE_QuickExp
* Description : this function is used to quickly get exp result
* Input :     HI_S32    s32Value           [IN]   input value
*
*
*
*
* Output :
* Return Value : HI_FLOAT: output value.
* Spec :
* Calls :
* Called By :
* History:
*
* 1. Date : 2017-11-10
* Author :
* Modification : Create
*
*****************************************************************************/
static HI_FLOAT SVP_NNIE_QuickExp( HI_S32 s32Value )
{
    if( s32Value & 0x80000000 )
    {
        // s32Value = ~s32Value + 0x00000001;
        s32Value = -s32Value;
        return s_af32ExpCoef[2][s32Value & 0x000003FF] * s_af32ExpCoef[3][(s32Value>>10) & 0x000003FF];
    }
    else
    {
        return s_af32ExpCoef[0][s32Value & 0x000003FF] * s_af32ExpCoef[1][(s32Value>>10) & 0x000003FF];
    }
}





